  nrmGradInf = 0.0;
  nrmDirInf = 1.0;
  for (idx = 0; idx < 69; idx++) {
    u1 = std::abs(grad_data[idx]);
    if ((!(nrmGradInf > u1)) && (!rtIsNaN(u1))) {
      nrmGradInf = u1;
    }

    u1 = std::abs(searchDir_data[idx]);
    if ((!(nrmDirInf > u1)) && (!rtIsNaN(u1))) {
      nrmDirInf = u1;
    }
  }

